import React from 'react';
import './App.css';
import {Button} from 'reactstrap';
import {ToastContainer,toast} from 'react-toastify';

function App() {
  const btnHandle = () =>{
    toast.success("Done", {
      position:'top-center'
    });
  }
  return (
  <div>
    <ToastContainer />
      <h1>This is bootstrap</h1>
      <Button onClick={btnHandle} color="warning" outline>
        First React Button
      </Button>
  </div>
  );
}

export default App;
